export default [

    //HEMSTÄD
    //BADRUM/WC


    {
        text: "Torka eluttag, lister, trösklar, fönsterbrädor, bänkytor, lampa"
    },
    {
        text: "Gör rent handfat (även undersida) och väggen bakom, under och på sidan. Putsa spegel, kran och tvålpump"
    },
    {
        text: "Torka underskåp och andra skåp. Ta med dammvippa ovanpå skåp"
    },
    {
        text: "Gör rent WC-stol på, runt, under och bakom. Torka rör och väggen bakom WC-stol"
    },
    {
        text: "Gör rent i duschkabin, dörrar och väggar. Putsa kranar och slang"
    },
]
